import './Error.css';
import { Link } from "react-router-dom";

export default function Error(){
    return(
        <>
            <h1 className="error__title">404</h1>
            <p className="error__text">Страница не найдена</p>
            <Link to="/" className="login__link">Назад</Link>
        </>
    )
}
